import React, { Component } from "react";
import { Image } from "react-bootstrap";
// import background from '../../img/background.png'
import "./home.css";
import img from "../../img/background.png";
import TopNavBar from "../TopNavbar/TopNavbar";
import BottomNavBar from "../BottomNavbar/BottomNavbar";
import GoogleLogin from "react-google-login";
import axios from "axios"

function home() {

     const responseSuccessGoogle = (response) =>{
         console.log(response);
         axios({
             method: "POST",
             url: "http://localhost:3001/api/googlelogin",
             data: {tokenId: response.tokenId}
         }).then(response =>{
             console.log("TOKENID: "+response.tokenId);
             localStorage.setItem('name', response.user)
             console.log("USERname"+ response.user)
         })

     }

     const responseErrorGoogle = (response) =>{
         
    }

    return (
      <div>
        <div>
          <TopNavBar />
        </div>

        <div className="bg-image">
          {/* <img src="../../img/background.png"></img>
                <Image 
                  style={background} responsive 
                  src="">
                </Image> */}
          <div className="centered">
            <div className="home-text-3">
              <p>
                <i>Share the love through music</i>
              </p>
            </div>
            <div className="home-text">
              <p>
                <b>ALMADEN YOUTH</b>
              </p>
            </div>
            <div className="home-text-2">
              <p>
                <b>MUSICIANS</b>
              </p>
            </div>
            <div>
              <GoogleLogin
                clientId="442136040847-7hd661tvopnum3aqpu8ik7l2n827m91c.apps.googleusercontent.com"
                buttonText="Login with Google"
                onSuccess={responseSuccessGoogle}
                onFailure={responseErrorGoogle}
                cookiePolicy={"single_host_origin"}
              />
            </div>
          </div>
        </div>
        <div>
          <BottomNavBar />
        </div>
      </div>
    );
  }

export default home
